import React, { Component } from 'react';
import Head from 'next/head';

// Market Data
import marketData from '../../data/market';
class MarketUser extends Component {
    
    constructor(props) {
        super(props);
        this.state = {
            marketUser: ''
        }
    }
    
    render() {
        return (
            <div>
                <Head>
                    <link href="https://fonts.googleapis.com/css?family=Montserrat:300,400,500,600,700&display=swap" rel="stylesheet" /> 
                    <link href="/static/style.css" rel="stylesheet" />
                </Head>
                <div className="container marketplace">
                    <div className="image-boxes">
                        <div className="image-box">
                            <div className="slide">
                                <img src="/img04.png" alt="Image description" />
                                <h3><a href="#">Aesthetic Record User</a></h3>
                            </div>
                        </div>
                        <div className="image-box">
                            <div className="slide">
                                <img src="/img05.png" alt="Image description" />
                                <h3><a href="#">Marketplace Vendor</a></h3>
                            </div>
                        </div>
                        <div className="arrows">
                            <button type="button" className="btn-arrow btn-left"><i className="icon-arrow-l"></i></button>
                            <button type="button" className="btn-arrow btn-right"><i className="icon-arrow-r"></i></button>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default MarketUser;
